         Мы позаботились о каждой детали, чтобы ваше путешествие через страницы книг стало незабываемым.
        </div>
            <ul className='contacts'>
              <li>Контакты:</li>
              <li>+79045033609 </li>
              <li>galybin.99@mail.ru</li>
              <li> < FaInstagram /> <FaTelegram /> </li>
            </ul>    
      </footer>
    )
}
